import '../App.css';
import './LocationSection.css';
import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';
import { Icon } from 'semantic-ui-react'


class LoactionSection extends Component {

  static defaultProps = {
    center: {
      lat: 16.691307,
      lng: 74.244865
    },
    zoom: 14
  };
  render() {
    return (
      <div className='location-container'>
      <h1>अरण्यगिरी फार्म हाऊस</h1>
      <div className='map'>
        <GoogleMapReact
          bootstrapURLKeys={{ key: "AIzaSyDUnHLz8Esrh1pWB8W04uJC95LoEmINBcI" }}
          defaultZoom={14}
          defaultCenter={{ lat: 16.691307, lng: 74.244865 }}
        >
          <Icon 
                 position= {{ lat: 16.691307, lng: 74.244865 }}
                name='map marker alternate'
                color='red' size='big'
                className='location-icon'
                />
        </GoogleMapReact>
      </div>
      </div>
    );
  }
}
  
  export default LoactionSection;
